import icon from "./ASSETS/icon.png";
import example_oentity from "./ASSETS/example_oentity.png";
import spawn_cow from "./ASSETS/spawn_cow.png";
class ExampleMod extends OMod {
  static title: string = "OvenMDK Example Mod";
  static description: string = "Example mod for OvenMDK INDEV";
  static credits: string = "Block_2222 and BendieGames";
  static icon: string = icon;
  static version: string = "0.0.2 DEV";
  static acceptedMinecraftVersions = ["1.8.8", "1.12.2"];
  static acceptedEFVersions = ["2.7.94"];

  static init(): void {
    console.log("logging uh idk");
    const itemTexture =
      "data:image/png;base64,";
    // IDs must be lowercase and unique.
    const exampleItem = new OItem(
      "Example OItem",
      "example_oItem",
      1,
      itemTexture,
      ($itemstack) => {
        if (!ModAPI.isServer) {
          ModAPI.displayToChat("Used example OItem!");
          console.log("Used example item!");
        }
      }
    );
    exampleItem.registerItem();
    const exampleItem2 = new OItem(
      "Example OItem2",
      "example_oItem2",
      1,
      itemTexture,
      ($itemstack) => {
        if (!ModAPI.isServer) {
          ModAPI.displayToChat("Used example OItem2!");
          console.log("Used example item2!");
        }
      }
    );
    exampleItem2.registerItem();
    // block IDs have to be lowercase otherwise errors
    const customBlock = new OBlock(
      "Example OBlock",
      "example_oblock",
      itemTexture,
      (world, pos, state) => {
        ModAPI.displayToChat("Block broken yayaayay");
        console.log(pos);
      }
    );
    customBlock.registerBlock();
    const customBlock2 = new OBlock(
      "Example OBlock2",
      "example_oblock2",
      itemTexture,
      (world, pos, state) => {
        ModAPI.displayToChat("Block2 broken yayaayay");
        console.log(pos);
      }
    );


    // DEV NOTE: OEntities are not yet completed in OvenMDK, this is just a placeholder for the name.
    const cool_sound_main = "data:audio/mpeg;base64,"
    const coolEntity = new OEntity(
      "ExampleOEntity",
      "example_oentity",
      example_oentity,
      "ModelCow",
      cool_sound_main,
      "wheat",
      "leather"
    );
    coolEntity.registerOEntity();
    const coolEntity_spawnegg = new OItem(
      "ExampleOEntity Spawn Egg",
      "example_oentity_spawnegg",
      64,
      spawn_cow,
      ($itemstack, $world, $player) => {
        console.log($itemstack)
        var player = ModAPI.util.wrap($player);
        var world = ModAPI.util.wrap($world);
        if (!ModAPI.isServer) {
          ModAPI.displayToChat("Spawned ExampleOEntity!");
          console.log("Spawned ExampleOEntity!");
        }
        /*
        old way of spawning mob ( DIDNT work only displayed model, not hitbox or AI )
        var coolEntityData = new globalThis["OEntity.example_oentity"].Entityexample_oentity(ModAPI.mc.theWorld.getRef());
        var pos = player.getPosition()
        coolEntityData.$setPosition(pos.getX(), pos.getY(), pos.getZ());
        ModAPI.mc.theWorld.spawnEntityInWorld(coolEntityData);
        */
        //console.log($player);
        //console.log(player);
        //OvenMDK__executeCommandAs($player, `/summon ExampleOEntity`, false)
      },
      ($$itemstack, $$world, $$player, $$blockpos) => {
        console.log($$blockpos);
        var spawn_x = $$blockpos.$x;
        var spawn_y = $$blockpos.$y + 1;
        var spawn_z = $$blockpos.$z;

        OvenMDK__executeCommandAs($$player, `/summon ExampleOEntity ${spawn_x} ${spawn_y} ${spawn_z}`, false);
      }
    );
    coolEntity_spawnegg.registerItem();

    customBlock2.registerBlock();
    // DEV NOTE: OCommands are not yet implemented in OvenMDK, this is just an placeholder for the name.
    simplecommand("/", "example_ocommand", () => {
      ModAPI.displayToChat("ran example Ocommand!");
    });
    const cool_ore = new OvenOre(
      "example_oblock",
      4,
      250,
      0,
      40,
    )
    cool_ore.registerOvenOre();

  }
}
OvenMDK.registerMod(ExampleMod);
